VALUES ('3596710261444', '2 Croque-monsieur à poêler', 'Pain de mie nature 53,5% (farine de blé (contient _gluten_), eau, dextrose, huile de colza, levure, sel, _gluten_ de blé; conservateur: propionate de calcium; épaississant: gomme xanthane; émulsifiants: mono - et diglycérides d\'acides gras, lécithines (colza), agent de traitement de la farine : acide ascorbique),  Fromage fondu 21,5% (contient _lait_) (fromages dont emmental &gt;30%, beurre, eau, protéines de lait, amidons transformés de maïs, lactosérum; sels de fonte : citrates de sodium, polyphosphates; gélifiant : carraghénanes), Jambon cuit standard 19,5% (jambon de porc, eau, sirop de glucose; conservateurs : lactate de potassium, nitrites de sodium; sel, arômes, plasma de porc; stabilisant : diphosphates; gélifiants : carraghénanes, farine de graines de caroube; acidifiant : citrate de potassium, dextrose, antioxydant : érythorbate de sodium), _margarine_ (graisse de palme, eau, huile de colza, émulsifiant : mono - et diglycérides d\'aicdes gras, correcteur d\'acidité : acide citrique).', 'https://static.openfoodfacts.org/images/products/359/671/026/1444/front_fr.5.400.jpg', '11.2', '6', '28.9', '3.5', '2.4', '12.2', '1.27', '0.5', '', '0');

