VALUES ('3596710335985', 'Bâtonnets Citron Sauce Sitron', 'Glace citron 56.8 % : _lait_ réhydraté, eau, jus de citron à base de concentré 16,3 %, sucre, sirop de glucose—fructose, sirop de glucose, graisse végétale (coprah), lactose (_) et protéines de _, émulsifiants : mono et diglycerides d\'acides gras, esters lactiques des mono et diglycérides d\'acides gras : gélifiants : farine de graines de caroube, gomme guar, arôme naturel de citron, arôme naturel.  Enrobage chocolat blanc 27.5 %: sucre, beurre de cacao, lactosérum en poudre (_), matière grasse de _ anhydre, _ écrémé en poudre, émulsifiants : lécithine de soja, polyricinoléate de polyglycérol, arôme.  Sauce citron 13,1% : sirop de glucose-fructose, eau, sucre, jaune d’_œuf_, épaississants : amidon modifié de mais, gomme guar , jus concentré de citron 3.1 %, matière grasse de lait anhydre, arômes naturels ; colorants : rocou, curcumine.  Morceaux de biscuit enrobés de beurre de cacao 2,6% : farine de _blé_, sucre, beurre de cacao 20,1 %, beurre (_), amidon de _blé_, noix de coco, _ écrémé en poudre, sel, arôme ; poudres à lever : carbonate acide de sodium, carbonate acide d’ammonium.     ', 'https://static.openfoodfacts.org/images/products/359/671/033/5985/front_fr.7.400.jpg', '11.9', '10.9', '28.9', '25.3', '0.2', '1.6', '0.127', '0.05', '', '0');

