VALUES ('3596710344697', 'Choucroute garnie Auchan', 'Choucroute cuisinée 66% : choucroute 49%, jus de cuisson, saindoux (graisse de porc fondue), graisse d\'oie, Riesling (contient sulfites), arôme, sel, baies de genièvre, antioxydant : acide ascorbique. Saucisse fumée cuite 9% : viande de porc eau, sel, épices et plantes aromatiques, stabilisants : triphosphates, diphosphates ; dextrose, antioxydants : érythorbate de sodium, acide ascorbique ; arômes, conservateur : nitrite de sodium. Enveloppe : boyau naturel de porc. Fumé au bois de hêtre. Knack 9% : viande de porc 4,1 %, gras de porc, eau, viande bovine 0,7%, sel, fibres de pois, protéines de lait, épices et plantes aromatiques, lactose (lait), stabilisants : triphosphates, diphosphates ; dextrose, exhausteur de goût : glutamate monosodique ; acidifiant : glucono-delta-lac - tone ; antioxydants : acide ascorbique, ascorbate de sodium ; extraits d\'épices, conservateur : nitrite de sodium. Enveloppe : boyau naturel de mouton. Fumé ao bois de hêtre. Pomme de terre 9% pomme de terre, sel, conservateur : disulfite de sodium. Filet de porc cuit fumé 4% : filet de porc traité en salaison 3,6%, eau, sel, dextrose, stabilisants : triphosphates, diphosphates ; sirop de glucose, arômes, antioxydant : érythorbate de sodium ; conservateur : nitrite de sodium. Fumé au bois de hêtre. ?pitrjne de porc fumée cuite 3% : poitrine de porc traitée en salaison 2,7%, eau, sel, stabilisants : triphosphates, diphosphates ; bouillon, sirop de glucose, dextrose, lactose (lait), conservateur : nitrite de sodiu(ïi ; arômes. Fumé au bois de hêtre. Elaboré à partir de porc Origine UE et de bœuf Origine France, Pourcentages exprimés sur le total de la recette. Traces éventuelles de fruits à coque, céleri, soja, œuf mularde gluten. Conditjonné sous atmosphère protectrice.', 'https://static.openfoodfacts.org/images/products/359/671/034/4697/front_fr.4.400.jpg', '7.9', '3.1', '3.7', '1', '3.8', '5.1', '1.52', '0.598425196850394', '', '0');

